    const [employes,setEmployes] = useState([]);
    
    useEffect(function (){
        async function getEmployes(){
            const data = fetch("http://localhost:4000/employes/")
            const EmployesData = await data.json();
            setEmployes(EmployesData)
        }
        getEmployes()
    },[])

    return (
        <>
            <></>
        </>
    )
}

